// Helper function for <dlfcn.h> functions. Runs the OPERATE function via _dl_catch_error.
// Returns zero for success, nonzero for failure; and arranges for `dlerror' to
// return the error details. ARGS is passed as argument to OPERATE.

// Call OPERATE, catching errors from `_dl_signal_error' and related functions.
// If there is no error, *ERRSTRING is set to null. If there is an error,
// *ERRSTRING is set to a string constructed from the strings passed to _dl_signal_error,
// and the error code passed is the return value and *OBJNAME is set to the object name
// which experienced the problems. ERRSTRING if nonzero points to a malloc'ed string
// which the caller has to free after use. ARGS is passed as argument to OPERATE.
// MALLOCEDP is set to true only if the returned string is allocated using the libc's malloc.

